(14,	1,	'2024-01-19 06:45:53',	'2024-01-19 06:45:53',	'<b>Accelerate your leadership career with High Impact Leaders, a flagship solution to unlock your digital leadership potential</b>\r\n\r\nDigital transformation and digitally savvy workers require digital leadership. The key to being measurably more effective is becoming measurably more affective.\r\n\r\nHow you digitally lead by example will determine your credibility, authenticity, and influence with your stakeholders.\r\n\r\nThe best leaders are great learners.\r\n\r\n<b>HIL is a transformative program to unlock your leadership potential and exponentially increase your leadership Impact. </b>\r\n\r\nDuring the course of the program, you will gain clarity and confidence on your next steps, build credibility &amp; trust and learn how to Influence your key stakeholders especially during uncertainty, change and disruption.\r\n\r\nThese are NOT pre-recorded, lecture-based webinars. Instead, these are active learning experiences. It is an experiential program where you get to apply the concepts in the real world.\r\n\r\n<b>In this online live 12 weeks program, you’ll develop competencies in 5 domains vital for strategic leadership:</b>\r\n\r\n<strong>Credibility</strong>\r\n\r\n<ul>\r\n 	<li aria-level=\"2\">Activate your best self.</li>\r\n 	<li aria-level=\"2\">Assess and leverage the strengths of others.</li>\r\n 	<li aria-level=\"2\">Develop strategic and critical thinking skills.</li>\r\n</ul>\r\n\r\n<strong>Sustainability</strong>\r\n<ul>\r\n\r\n 	<li aria-level=\"2\">Gain a deeper understanding of yourself.</li>\r\n 	<li aria-level=\"2\">Increase self and social awareness.</li>\r\n 	<li aria-level=\"2\">Adopt growth mindset.</li>\r\n</ul>\r\n\r\n<strong>Capability</strong>\r\n<ul>\r\n \r\n 	<li aria-level=\"2\">Build the essential skills, habits and routines of high impact leaders.</li>\r\n 	<li aria-level=\"2\">Strengthen interpersonal connections.</li>\r\n 	<li aria-level=\"2\">Act with emotional agility and balance.</li>\r\n</ul>\r\n\r\n<strong>Visibility</strong>\r\n\r\n<ul>\r\n 	<li aria-level=\"2\">Create effective communication and collaboration techniques.</li>\r\n 	<li aria-level=\"2\">Build your executive leadership presence.</li>\r\n 	<li aria-level=\"2\">Influence and manage stakeholders’ expectations.</li>\r\n</ul>\r\n\r\n<strong>Agility</strong>\r\n<ul>\r\n 	<li aria-level=\"2\">Adapt quickly and nimbly respond to change.</li>\r\n 	<li aria-level=\"2\">Take risks and operate at the edge of chaos.</li>\r\n 	<li aria-level=\"2\">Lead change and digital transformations.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<h3><strong>As a result, you’ll:</strong></h3>\r\n<ul>\r\n 	<li aria-level=\"1\">Gain clarity on what might be holding you back.</li>\r\n 	<li aria-level=\"1\">Leverage your strengths and turn your liabilities into assets.</li>\r\n 	<li aria-level=\"1\">Become more strategic, focused and productive.</li>\r\n 	<li aria-level=\"1\">Solve complex problems.</li>\r\n 	<li aria-level=\"1\">Build your credibility and raise your profile in an authentic way.</li>\r\n 	<li aria-level=\"1\">Increase your confidence and self-esteem.</li>\r\n 	<li aria-level=\"1\">Develop relationships with senior decision-makers, sponsors and influencers.</li>\r\n 	<li aria-level=\"1\">Negotiate and ask for what you want.</li>\r\n 	<li aria-level=\"1\">Handle productive conflicts.</li>\r\n 	<li aria-level=\"1\">Improve your leadership effectiveness.</li>\r\n 	<li aria-level=\"1\">Build your unique leadership brand.</li>\r\n</ul>\r\n<p class=\"note\">If you want to be perceived as a credible and competent leader, confidently put your ideas across to your boss or the board, accelerate your leadership career and accomplish your most important goals then this program is for you.</p>',	'HIGH IMPACT LEADERS',	'',	'publish',	'open',	'closed',	'',	'high-impact-leaders',	'',	'',	'2024-01-24 09:51:42',	'2024-01-24 09:51:42',	'',	0,	'http://localhost/archanashetty/?post_type=product&#038;p=14',	0,