(32,	1,	'2024-01-24 09:49:32',	'2024-01-24 09:49:32',	'<b>Accelerate your leadership career with High Impact Leaders, a flagship solution to unlock your digital leadership potential</b>\n\nDigital transformation and digitally savvy workers require digital leadership. The key to being measurably more effective is becoming measurably more affective.\n\nHow you digitally lead by example will determine your credibility, authenticity, and influence with your stakeholders.\n\nThe best leaders are great learners.\n\n<b>HIL is a transformative program to unlock your leadership potential and exponentially increase your leadership Impact. </b>\n\nDuring the course of the program, you will gain clarity and confidence on your next steps, build credibility &amp; trust and learn how to Influence your key stakeholders especially during uncertainty, change and disruption.\n\nThese are NOT pre-recorded, lecture-based webinars. Instead, these are active learning experiences. It is an experiential program where you get to apply the concepts in the real world.\n\n<b>In this online live 12 weeks program, you’ll develop competencies in 5 domains vital for strategic leadership:</b>\n\n<strong>Credibility</strong>\n<ul>\n 	<li style=\"list-style-type: none;\">\n<ul>\n 	<li aria-level=\"2\">Activate your best self.</li>\n 	<li aria-level=\"2\">Assess and leverage the strengths of others.</li>\n 	<li aria-level=\"2\">Develop strategic and critical thinking skills.</li>\n</ul>\n</li>\n</ul>\n<strong>Sustainability</strong>\n<ul>\n 	<li style=\"list-style-type: none;\">\n<ul>\n 	<li aria-level=\"2\">Gain a deeper understanding of yourself.</li>\n 	<li aria-level=\"2\">Increase self and social awareness.</li>\n 	<li aria-level=\"2\">Adopt growth mindset.</li>\n</ul>\n</li>\n</ul>\n<strong>Capability</strong>\n<ul>\n 	<li style=\"list-style-type: none;\">\n<ul>\n 	<li aria-level=\"2\">Build the essential skills, habits and routines of high impact leaders.</li>\n 	<li aria-level=\"2\">Strengthen interpersonal connections.</li>\n 	<li aria-level=\"2\">Act with emotional agility and balance.</li>\n</ul>\n</li>\n</ul>\n<strong>Visibility</strong>\n<ul>\n 	<li style=\"list-style-type: none;\">\n<ul>\n 	<li aria-level=\"2\">Create effective communication and collaboration techniques.</li>\n 	<li aria-level=\"2\">Build your executive leadership presence.</li>\n 	<li aria-level=\"2\">Influence and manage stakeholders’ expectations.</li>\n</ul>\n</li>\n 	<li aria-level=\"1\">Agility\n<ul>\n 	<li aria-level=\"2\">Adapt quickly and nimbly respond to change.</li>\n 	<li aria-level=\"2\">Take risks and operate at the edge of chaos.</li>\n 	<li aria-level=\"2\">Lead change and digital transformations.</li>\n</ul>\n</li>\n</ul>\n<h3><strong>As a result, you’ll:</strong></h3>\n<ul>\n 	<li aria-level=\"1\">Gain clarity on what might be holding you back.</li>\n 	<li aria-level=\"1\">Leverage your strengths and turn your liabilities into assets.</li>\n 	<li aria-level=\"1\">Become more strategic, focused and productive.</li>\n 	<li aria-level=\"1\">Solve complex problems.</li>\n 	<li aria-level=\"1\">Build your credibility and raise your profile in an authentic way.</li>\n 	<li aria-level=\"1\">Increase your confidence and self-esteem.</li>\n 	<li aria-level=\"1\">Develop relationships with senior decision-makers, sponsors and influencers.</li>\n 	<li aria-level=\"1\">Negotiate and ask for what you want.</li>\n 	<li aria-level=\"1\">Handle productive conflicts.</li>\n 	<li aria-level=\"1\">Improve your leadership effectiveness.</li>\n 	<li aria-level=\"1\">Build your unique leadership brand.</li>\n</ul>\n<p class=\"note\">If you want to be perceived as a credible and competent leader, confidently put your ideas across to your boss or the board, accelerate your leadership career and accomplish your most important goals then this program is for you.</p>',	'HIGH IMPACT LEADERS',	'',	'inherit',	'closed',	'closed',	'',	'14-autosave-v1',	'',	'',	'2024-01-24 09:49:32',	'2024-01-24 09:49:32',	'',	14,	'https://www.thetechtales.com/archanashetty/?p=32',	0,	'revision',	'',	0),
(34,	1,	'2024-01-24 09:36:07',	'2024-01-24 09:36:07',	'<b>Reduce the risk of failure in digital transformations and accelerate speed to market by building high performing, high impact teams.</b>\r\n\r\n<span style=\"font-weight: 400;\">A</span><span style=\"font-weight: 400;\">ccording to research by McKinsey</span><span style=\"font-weight: 400;\"> more than </span><a href=\"https://www.mckinsey.com/capabilities/transformation/our-insights/perspectives-on-transformation\"><span style=\"font-weight: 400;\">70% of digital transformations fail</span></a><span style=\"font-weight: 400;\">. </span>\r\n\r\n<span style=\"font-weight: 400;\">We help you bring your teams together to work smarter, move faster, break silos, increase collaboration, accountability and your odds of success.</span>\r\n\r\n<span style=\"font-weight: 400;\">We make it easy for you to successfully deliver your key project outcomes using a systemic lens with the 7 P’s framework (</span><b>Purpose, Principles, People, Partners, Processes, Product, Performance)</b>\r\n\r\n<b>1. Purpose and Principles to create Alignment:</b>\r\n\r\n<span style=\"font-weight: 400;\">Learn the operating principles that govern high performing, high impact teams and hold them accountable for their behavior and delivery.</span>\r\n\r\n<span style=\"font-weight: 400;\">Cultivate the skills to create alignment between organization and team goals, develop a deep sense of purpose so they willingly go the extra mile and build trust to galvanize the team.</span>\r\n\r\n<b>2. People, Partners to build the internal capacity for execution : </b>\r\n\r\n<span style=\"font-weight: 400;\">Learn the strategies to create conditions to help people and partners reach their full potential. Learn tips and techniques to enable and empower employees, how to develop their abilities so they are internally motivated and are able to perform at their best.</span>\r\n\r\n<span style=\"font-weight: 400;\">Learn how to build the social capital and strengthen connections with and between cross functional teams and larger ecosystem so they feel a sense of community and are able to weather inevitable setbacks.</span>\r\n\r\n<b>3. Processes, Product, Performance to track and measure progress: </b>\r\n\r\n<span style=\"font-weight: 400;\">Learn the governance processes, performance measures and risk mitigation strategies you need to put in place in order to track the behavior of people and measure the progress of the projects.</span>\r\n\r\n<span style=\"font-weight: 400;\">As a result, the team is motivated, agile and more accountable for the delivery; they spend less time reacting and regrouping, and more time getting results.</span>\r\n\r\n&nbsp;\r\n\r\n<b>This program is delivered via online or in-person workshops.</b>\r\n\r\n<span style=\"font-weight: 400;\">These are NOT pre-recorded, lecture-based webinars. Instead, these are active learning via engaging and interactive workshops.</span>\r\n<p class=\"note\">Become a HIT Leader and Increase the success rate of your digital transformation projects.</p>',	'High Impact Teams',	'',	'publish',	'open',	'closed',	'',	'high-impact-teams',	'',	'',	'2024-01-24 09:47:35',	'2024-01-24 09:47:35',	'',	0,	'https://www.thetechtales.com/archanashetty/?post_type=product&#038;p=34',	0,	'product',	'',	0),
(35,	1,	'2024-01-24 09:37:13',	'2024-01-24 09:37:13',	'<b><i>Reduce the risk of failure in digital transformations and accelerate speed to market by building high performing, high impact teams.</i></b>\n\n<span style=\"font-weight: 400;\">A</span><span style=\"font-weight: 400;\">ccording to research by McKinsey</span><span style=\"font-weight: 400;\"> more than </span><a href=\"https://www.mckinsey.com/capabilities/transformation/our-insights/perspectives-on-transformation\"><span style=\"font-weight: 400;\">70% of digital transformations fail</span></a><span style=\"font-weight: 400;\">. </span>\n\n<span style=\"font-weight: 400;\">We help you bring your teams together to work smarter, move faster, break silos, increase collaboration, accountability and your odds of success.</span>\n\n<span style=\"font-weight: 400;\">We make it easy for you to successfully deliver your key project outcomes using a systemic lens with the 7 P’s framework (</span><b>Purpose, Principles, People, Partners, Processes, Product, Performance)</b>\n\n<b></b>\n<ul>\n 	<li aria-level=\"1\"><b>Purpose and Principles to create Alignment:</b></li>\n</ul>\n&nbsp;\n\n<span style=\"font-weight: 400;\">Learn the operating principles that govern high performing, high impact teams and hold them accountable for their behavior and delivery.</span>\n\n&nbsp;\n\n<span style=\"font-weight: 400;\">Cultivate the skills to create alignment between organization and team goals, develop a deep sense of purpose so they willingly go the extra mile and build trust to galvanize the team.</span>\n\n&nbsp;\n<ol>\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><b>People, Partners to build the internal capacity for execution : </b></li>\n</ol>\n&nbsp;\n\n<span style=\"font-weight: 400;\">Learn the strategies to create conditions to help people and partners reach their full potential. Learn tips and techniques to enable and empower employees, how to develop their abilities so they are internally motivated and are able to perform at their best.</span>\n\n<span style=\"font-weight: 400;\">Learn how to build the social capital and strengthen connections with and between cross functional teams and larger ecosystem so they feel a sense of community and are able to weather inevitable setbacks.</span>\n<ul>\n 	<li aria-level=\"1\"><b>Processes, Product, Performance to track and measure progress: </b></li>\n</ul>\n&nbsp;\n\n<span style=\"font-weight: 400;\">Learn the governance processes, performance measures and risk mitigation strategies you need to put in place in order to track the behavior of people and measure the progress of the projects.</span>\n\n<span style=\"font-weight: 400;\">As a result, the team is motivated, agile and more accountable for the delivery; they spend less time reacting and regrouping, and more time getting results.</span>\n\n<b>This program is delivered via online or in-person workshops.</b>\n\n<span style=\"font-weight: 400;\">These are NOT pre-recorded, lecture-based webinars. Instead, these are active learning via engaging and interactive workshops.</span>\n\n<p class=\"note\">Become a HIT Leader and Increase the success rate of your digital transformation projects.</b>',	'High Impact Teams',	'',	'inherit',	'closed',	'closed',	'',	'34-autosave-v1',	'',	'',	'2024-01-24 09:37:13',	'2024-01-24 09:37:13',	'',	34,	'https://www.thetechtales.com/archanashetty/?p=35',	0,	'revision',	'',	0),
(36,	1,	'2024-01-24 09:41:17',	'2024-01-24 09:41:17',	'<b>Reduce attrition, improve employee experience and keep your talent engaged and happy by developing the coaching skills of your managers.</b>\r\n\r\n<span style=\"font-weight: 400;\">Positive, high impact behaviors of managers create a healthy environment for employees to thrive.</span>\r\n\r\n<span style=\"font-weight: 400;\">Through this program, you will: </span>\r\n<ul>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Get insight into how to support your direct reports\' according to their workstyle, their strengths, on areas they’re struggling with and ways to reduce burnout. </span></li>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Unlock your direct reports and teams\' full potential with the power of coaching.</span></li>\r\n 	<li style=\"font-weight: 400;\" aria-level=\"1\"><span style=\"font-weight: 400;\">Identify the motivations and drainers of your employees.</span></li>\r\n</ul>\r\n<b>This program is delivered via online or in-person workshops.</b>\r\n\r\n<span style=\"font-weight: 400;\">These are NOT pre-recorded, lecture-based webinars. Instead, these are active learning via engaging and interactive workshops.</span>\r\n<p class=\"note\">Build high impact managers and create a thriving workplace so your top talent won\'t want to leave.</p>',	'High Impact Managers',	'',	'publish',	'open',	'closed',	'',	'high-impact-managers',	'',	'',	'2024-01-25 11:38:34',	'2024-01-25 11:38:34',	'',	0,	'https://www.thetechtales.com/archanashetty/?post_type=product&#038;p=36',	0,	'product',	'',	0),
